import React, { Component } from 'react'
import './index.css';
import store from '../../../../Redux/store';
export default class SearchResVideos extends Component {

  componentDidMount() {

  }

  timeFormat(time) {
    time /= 1000;
    let min = Math.floor(time / 60),
      sec = time % 60;
    return ("0" + min).slice(-2) + ":" + ("0" + sec).slice(-2);
  }
  render() {
    let { videos } = store.getState();
    videos = videos || [];
    console.log('Resvideos', videos, videos.length);
    return (
      <div className='SearchResVideos'>
        {videos.length ?
          videos.map(v => {
            <div className='video' key={v.vid} id={v.vid}>
              <div className='video-cover'>
                <img src={v.coverUrl}></img>
              </div>
              <div className='video-title'>{v.title}</div>
              <div className='video-creator'>{v.creator.map(c => <span id={c.userId}>{c.userName}</span>)}</div>
            </div>
          })
          :
          <div>加载中...</div>}
      </div>
    )
  }
}
